import logo from "./logo.svg";
import "./App.css";
import FormImport from "./view/FormImport";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter,
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>

        <Route path="/Intro">
          <Intro />
        </Route>

        <Route path="/Procedure">
          <Procedure />
        </Route>

        <Route path="/UsingInstructions">
          <UsingInstructions />
        </Route>

        <Route path="/Contact">
          <Contact />
        </Route>

        <Route path="/Login">
          <Login />
        </Route>

        <Route path="/Register">
          <Register />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
